I'm not sure if this is exactly what you're looking for, but I've created a class that can be used to stack multiple images on top of each other.

```
class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: CGFloat = 0.70

    init(images: [UIImage], iconScale: CGFloat = 0.70) {
        self.images = images
        self.iconScale = iconScale
    }

    func stackImages() -> UIImage {
        let newWidth = images.reduce(0) { $0 + $1.size.width }
        let iconsSize = floor(newWidth * iconScale).rounded(.down)
        let iconsInset = (newWidth - iconsSize) - 1

        let stackedImage = UIImage.init(size: CGSize(width: newWidth, height: iconsSize))
        let context = CGContext(data: nil, width: Int(newWidth), height: Int(iconsSize), bitsPerComponent: 8, bytesPerRow: 0, space: CGColorSpaceCreateDeviceRGB(), bitmapInfo: CGImageAlphaInfo.premultipliedLast.rawValue)!
        context.setFillColor(UIColor.white.cgColor)
        context.fill(CGRect(x: 0, y: 0, width: newWidth, height: iconsSize))

        for (index, image) in images.enumerated() {
            let imageSize = image.size
            let imageInset = CGFloat(index) * imageSize.width
            let imageRect = CGRect(x: imageInset, y: 0, width: imageSize.width, height: iconsSize)
            context.draw(image.cgImage!, in: imageRect)
        }

        return UIImage(cgImage: context.makeImage()!)
    }
}
```

